import React from 'react';
import Image from '../component/Image';
import fun_cat from 'D:\Games\AvardSir\react teach\my-app\src\img\fun_cat\fun_cat.jpg'
class Input extends React.Component {
  // Метод helloPrint
  helloPrint() {
    return console.log('hello! onClick');
  }

  onMouse() {
    return console.log('hello! onMouse');
  }

  // Переменная par
  par = 'Введите текст';

  // Метод render
  render() {
    return (
      <input 
        placeholder={this.par} 
        onClick={this.helloPrint.bind(this)} 
        onMouseEnter={this.onMouse.bind(this)}
      />
    );
  }
}

function EmmtyText() {
  return (<p>Шаблон для вашего текста</p>);
}

class NewText extends React.Component {
  render() {
    return (<p>{this.props.title}</p>);
  }
}

function app_() {
  return (
    <div className='App'>
      <Input />
     
      <EmmtyText />
      {/* <NewText title='lol'/>
      <NewText title='хехе'/> */}
      <Image image={fun_cat}/>
    </div>
  );
}

export default app_;
